CREATE DATABASE QuanLyQuayThuocBenhVienTest
GO
USE QuanLyQuayThuocBenhVienTest
GO
SET DATEFORMAT dmy
GO

CREATE TABLE NhanVien
(
	MaNV varchar(10) not null constraint PK_NV PRIMARY KEY,
	HoTenNhanVien nvarchar(40),
	NgaySinh date,
	NgayVaoLam date,
	GioiTinh nvarchar(3),
	SoCMND varchar(12),
	Email varchar(40),
	SoDienThoai varchar(20),
	DiaChi nvarchar(150),
	ChucVu nvarchar(20),
	TinhTrang nvarchar(20)
);

CREATE TABLE TaiKhoan
(
	MaNV varchar(10) constraint FK_MaNV_TaiKhoan_NhanVien FOREIGN KEY REFERENCES NhanVien(MaNV) ON DELETE CASCADE ON UPDATE CASCADE,
	MatKhau varchar(50),
	HinhAnh image,
	TrangThai nvarchar(40)
);

CREATE TABLE KhachHang
(
	MaKH varchar(14) not null constraint PK_KH PRIMARY KEY,
	HoTenKhachHang nvarchar(40),
	NgaySinh date,
	NgayDangKy date,
	MaTheBaoHiem char(15),
	GioiTinh nvarchar(3),
	SoCMND varchar(12),
	Email varchar(40),
	SoDienThoai varchar(20),
	DiaChi nvarchar(150)
);

CREATE TABLE NhaCungCap
(
	MaNCC char(8) not null constraint PK_NCC PRIMARY KEY,
	TenNCC nvarchar(70),
	Email varchar(40),
	SoDienThoai varchar(20),
	DiaChi nvarchar(150)
);

CREATE TABLE Thuoc
(
	MaThuoc char(12) not null constraint PK_THUOC PRIMARY KEY,
	TenThuoc nvarchar(50),
	LoaiThuoc nvarchar(40),
	DonViThuoc nvarchar(20),
	XuatXu nvarchar(40),
	SoLuongTon int,
	MaNCC char(8) constraint FK_MaNCC_Thuoc_NhaCungCap FOREIGN KEY REFERENCES NhaCungCap(MaNCC) ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE PhieuNhapThuoc
(
	MaPhieu char(12) not null constraint PK_PhieuNhapThuoc PRIMARY KEY,
	MaNV varchar(10) constraint FK_MaNV_PhieuNhapThuoc_NhanVien FOREIGN KEY REFERENCES NhanVien(MaNV) ON DELETE CASCADE ON UPDATE CASCADE,
	MaThuoc char(12) constraint FK_MaThuoc_PhieuNhapThuoc_Thuoc FOREIGN KEY REFERENCES Thuoc(MaThuoc) ON DELETE CASCADE ON UPDATE CASCADE,
	NgayNhap date,
	NgaySanXuat date,
	NgayHetHan date,
	DonGiaMua float,
	SoLuongNhap int
);

CREATE TABLE HoaDon
(
	MaHD char(15) not null constraint PK_HD PRIMARY KEY,
	MaKH varchar(14) constraint FK_MaKH_HoaDon_KhachHang FOREIGN KEY REFERENCES KhachHang(MaKH) ON DELETE CASCADE ON UPDATE CASCADE,
	MaNV varchar(10) constraint FK_MaNV_HoaDon_NhanVien FOREIGN KEY REFERENCES NhanVien(MaNV) ON DELETE CASCADE ON UPDATE CASCADE,
	NgayLapHoaDon date,
	TheBaoHiem nvarchar(5),
	MienGiam float
);

CREATE TABLE ChiTietHoaDon
(
	MaHD char(15) constraint FK_MaHD_ChiTietHoaDon_HoaDon FOREIGN KEY REFERENCES HoaDon(MaHD) ON DELETE CASCADE ON UPDATE CASCADE,
	MaThuoc char(12) constraint FK_MaThuoc_ChiTietHoaDon_Thuoc FOREIGN KEY REFERENCES Thuoc(MaThuoc) ON DELETE CASCADE ON UPDATE CASCADE,
	SoLuong int,
	DonGiaBan float,
	constraint PK_ChiTietHoaDon PRIMARY KEY (MaHD,MaThuoc)
);

